import numpy as np

def safe_div(a, b):
    """Performs safe division, preventing broadcasting issues and division by zero."""
    a, b = np.asarray(a), np.asarray(b)

    # If a is a scalar and b is an array, expand a to match b's shape
    if a.shape == () and b.shape != ():
        a = np.full_like(b, a)

    # If b is a scalar and a is an array, expand b to match a's shape
    elif b.shape == () and a.shape != ():
        b = np.full_like(a, b)

    # Avoid division by very small values
    mask = np.abs(b) > 1e-6
    result = np.ones_like(a)

    # Perform safe division only where b is valid
    np.divide(a, b, out=result, where=mask)

    return result

def safe_log(x):
    return np.log1p(np.abs(x))  

def safe_tan(x):
    return np.tan(np.clip(x, -np.pi/3, np.pi/3))

def safe_exp(x):
    return np.exp(np.clip(x, -100, 100))

def safe_pow(a, b):
    return np.power(np.abs(a), np.clip(b, -5, 5))

def safe_sqrt(x):
    return np.sqrt(np.abs(x))

def safe_arcsin(x):
    return np.arcsin(np.clip(x, -1, 1))

def safe_arccos(x):
    return np.arccos(np.clip(x, -1, 1))


